import Pomodoro from "./Pomodoro";

function IncrementDecrementButton(event, disable, value, name) {
    const hey = durationHandler(event)
    return (
      <button
        type="button"
        className="btn btn-primary"
        data-testid="decrease-focus"
        onClick={hey}
        disabled={disable}
        value={value}
        name={name}
      >
        <span className="oi oi-minus" />
      </button>
    )
}
